import React from 'react';

import "../css/Global.css";
import "../css/CampusFacilitiesMap.css";

import TopNav from '../components/TopNav';
import Menu from '../components/Menu';

const CampusFacilitiesMap: React.FC = () => {

    return (
        <IonPage>
            <TopNav title="Campus Facilities Map" route='/u/home' backarrow={ true } hamburger = { true }/>
            
            <IonContent fullscreen={true} className="campusFacilMapIonContent">
                <IonGrid className="campusFacilGrid">
                    <IonRow id="campusMapImg">
                        <div className="mapouter">
                            <div className="gmap_canvas">
                                <iframe width="600" height="500" id="gmap_canvas" src="https://maps.google.com/maps?q=singapore%20institute%20of%20management&t=k&z=13&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe>
                                <a href="https://www.embedgooglemap.net">google map widget for website</a>
                            </div>
                        </div>
                    </IonRow>

                    <IonRow>

                    </IonRow>
                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default CampusFacilitiesMap;
